(23, 0, 'Parkash Hospital ', 'A hospital is a health care institution providing patient treatment with specialized medical and nursing staff and medical equipment. ... The medical facility smaller than a hospital is generally called a clinic. Hospitals have a range of departments (e.g.: surgery and urgent care) and specialist units such as cardiology.', '#', 'House no. 2805, Phase 7', 'mohali', 'Chandigarh', '160062', NULL, NULL, NULL, 1, 1491565184),
