(1, 0, 9, 'Web Developer', NULL, 'This web developer sample job description can assist in your creating a job application that will attract job candidates who are qualified for the job. Feel free to revise this job description to meet your specific job duties and job requirements.', 'JavaScript, JQuery, HTML, HTML5, CSS, CSS3, Web Programming Skills, E-Commerce, Teamwork, Verbal Communication, cross-browser compatibility, Web User Interface Design (UI), Security Principles, Object-Oriented Design, Web Services (REST/SOAP), Multimedia Content Development, API''s\n\n ', 'EXP 2 yrs', 'Btech', 'INR 20-k', 'full-time', 0, 1490336031, 0),
(2, 0, 10, 'java Developer', NULL, 'This Java developer job description template is optimized for posting in online job boards or careers pages and easy to customize for your company. Modify this Java job description to hire for other J2EE or Java programmer roles at your company.', ' Java Server Faces (JSF), Spring MVC, Vaadin/GWT, Wicket, PlayHibernate, Java Persistence API (JPA), EclipseLink, OpenJPA', 'exp-2yrs', 'Btech ', 'INR 20-k', 'full-time', 1, 1490341220, 0),
(3, 0, 11, 'Sales Marketing', NULL, 'Sales and marketing are two different disciplines. Sales book new business and marketing creates strategies for product development, pricing, promotions and distribution. This process is often reversed in small companies with limited product lines or target customer profiles. In this case, one person often manages sales and marketing, with the emphasis on sales strategies supported by marketing activities limited to promotional efforts.', 'Understand what the buyer wants,Sell in a buyer-responsive manner,Use psychology to engage the buyer,Establish trust with the buyer,Communicate succinctly,Act on what the customer is saying\n', 'experienced 2 years', 'Graduation', 'INR 20-k', 'full-time', 1, 1490426200, 0),
(4, 0, 12, 'telecaller', NULL, 'The BPO specialist is person who is responsible for performing all customer service oriented e-mail and telephone support activities as he/she was directed by the cal center manager. A BPO specialists job duties are primarily service focused, communication driven and customer centered. A BPO specialist is expected to have experience, understanding and knowledge to handle all customer inquiries/responses.', 'Leadership and responsibility,Critical thinking and problem solving,Flexibility and adaptability,Productivity and accountability,Good communication skills', 'Fresher', 'Graduation', 'INR 7k to 10k', 'full-time', 1, 1490427008, 0),
(5, 0, 13, 'content writer', NULL, 'This is a newly customized position to fit our awesome Company culture and add to our dynamic Marketing Department. This person will be responsible for creating, improving and maintaining content to achieve business goals. Duties will also include sharing content to raise brand awareness and increase web traffic and social media interaction.\nOur ideal candidate is an experienced professional with demonstrable creative writing skills. As a Content Writer, this person should perform well under deadlines and be detail-oriented. Ultimately, the Content Writer will be overseeing all marketing content initiatives to ensure customer engagement, brand consistency and a positive customer experience.', 'Adaptability,Researching your way to good content,Excellent overall writing skills in a number of different styles/tones,Impeccable spelling and grammar,A deep understanding of consumers and what motivates them online,Great research, organizational, and learning skills,High comprehension of software like Microsoft Word and Google Docs', 'Exp 2y', 'Graduation , Post-Graduation', 'INR 15k - 25K', 'full-time', 1, 1490428724, 0),
(6, 0, 14, 'Waiter', NULL, 'You will be responsible to provide an excellent and consistent level of service to your customers. The Waiter/Waitress is responsible to serve Food & Beverage to guests in the assigned Place of Work, provide a courteous, professional, efficient and flexible service in order to maximize guest satisfaction.', 'Good personal presentation skills.,\nTo be friendly, polite and helpful.,\nTo be patient and diplomatic when dealing with complaints.,\nGood memory.\n', 'Fresher', '12th+', 'INR  5 - 10 K', 'full-time', 1, 1490429109, 0),
