(15, 0, 23, 'MD medicine,Radiology,general surgery', NULL, 'Radiologists use medical imaging technologies, such as X-rays, CT scans and MRIs, to diagnose and make treatment decisions regarding patients'' health problems. Radiologists are fully licensed physicians who complete at least eleven years of higher education, which includes an undergraduate degree program, Doctor of Medicine program and a residency. Additionally, all medical doctors must be licensed to practice. Many choose to become certified by the American Board of Medical Specialties.', 'Attention to detail,Ability to work as an individual and as part of a medical team of specialists,\nExcellent communication skills,Able to work well in stressful conditions,Critical thinking,\nExtensive knowledge of and an aptitude for the medical profession,Real desire to help patients get better,', '0-10 yrs', 'Graduation', '30000', 'full-time', 1, 1491565549, 0),
(16, 0, 24, 'public dental professor,medicine,periodontics,Conservative dental reader', NULL, 'Hospital dental practice is highly specialized and covers oral and maxillofacial surgery or oral surgery & orthodontics & pediatric dentistry and restorative dentistry. dental care of short-stay patients when this is required for pain relief or other emergency or as part of, or in support of their general treatment.', 'Communication,Patience,A thorough and methodical approach,Ability to work long hours, often under pressure,Good ethical grounding,Teamwork skills,', '0-10yrs', 'Graduation', '30000', 'full-time', 1, 1491566862, 0),
