(24, 0, 35, 'AEM Lead Developer', NULL, 'Adobe Experience Manager Application Developer Expert will be part of a team that is responsible for delivering an Adobe Experience Manager (AEM) implementation. ', 'Strong working knowledge in Java or J2EE, Web services, XML, AJAX, JS and UI Skills. Leveraging web content management components of AEM to customize and port customer websites is required - DAM, SoCo, MSM, Tagging, work flow. Excellent communication skills.', 'Requires 6+ years of experience in J2EE development inclusive of 2+ years of relevant experience in Adobe AEM / WEM foundational concepts and a solid understanding of AEM building blocks, SLING, FELIX, JSR-170. ', 'Graduation in relevant field', 'INR not desclosed', 'full-time', 1, 1491813320, 0),
