(34, 0, 38, 'Finance and Commercial-Executive/Manager', NULL, 'Commercial account executives design, promote and coordinate business-to-business sales. They meet with clients in a specified regional area or territory to demonstrate and promote products, as well as train clients in how to promote products. Commercial account executives may attend trade shows or seminars. Commercial account executives will often handle market research and budget reports.', 'Experience of handling excise, sales tax, VAT, service tax, custom import. Preference for manufacturing finance background.', '5-8 yrs', 'CA-Inter / MBA Finance / B.Com minimum ', 'INR  not desclosed', 'full-time', 1, 1491883399, 0),
(35, 0, 38, 'Hardware Design Engineer-Automated Control', NULL, 'Hardware architecture is the representation of an engineered (or to be engineered) electronic or electro mechanical hardware system, and the process and discipline for effectively implementing the design(s) for such a system.', 'Experience of handling precision circuits for timing & amplitude generation, feedback circuits & motor drive circuits, discrete storage and counting circuits required.Thorough knowledge of project management process for electronic systems development, Knowledge about quality processes and practices as applicable to defense electronics.\n', '2-4 yrs', 'BE/B. Tech Electronics', 'INR  not desclosed', 'full-time', 1, 1491884946, 0),
(36, 0, 38, 'Hardware Design Engineer-Power', NULL, 'Hardware architecture is the representation of an engineered (or to be engineered) electronic or electro mechanical hardware system, and the process and discipline for effectively implementing the design(s) for such a system.', 'Experience of developing power supply and high voltage circuits and integrating & testing them in an embedded system. Thorough knowledge of developing analog circuits including control circuits based on discreet components.Knowledge of project management process for electronic systems development Experience of designing as per Military standards.\n', '2-4 yrs', 'BE/B. Tech Electronics', 'INR  not desclosed', 'full-time', 1, 1491885763, 0),
(37, 0, 38, 'Firmware Engineer', NULL, 'A firmware engineer is responsible for the development and implementation of software for industry specific applications and systems. A firmware engineer plans, improves and manages software applications from inception to use.', 'Integration of wireless & control technologies, Micro controller based hardware & firmware design using low power techniques, Experience in Wireless interfacing\n', '2-4 yrs', 'BE/B. Tech Electronics', 'INR  not desclosed', 'full-time', 1, 1491887447, 0),
(38, 0, 38, 'Mechanical Engineer', NULL, 'Mechanical engineers design power-producing machines such as electric generators, internal combustion engines, and steam and gas turbines as well as power-using machines, such as refrigeration and air-conditioning systems.', 'Experience in designing sheet metal component & Vendor Development., Must have in depth knowledge of developing sheet metal component, Experience of interacting with vendors\nExcellent communication skills\n', '4-8 yrs', 'Diploma/BE Mechanical', 'INR  not desclosed', 'full-time', 1, 1491887691, 0),
(39, 0, 38, 'Sales Manager', NULL, 'Sales managers work with large profile customers or with customer complaints, analyze budgets, and determine ways to streamline and improve the sales process.', 'Creating business opportunities with Defense Electronics R&D labs and PSUs. Good understanding of electronics technology, and a commitment to meet targets is essential. Excellent interpersonal & communication skills.\n', '3-5 yrs', 'BE/B. Tech Electronics/Computers', 'INR  not desclosed', 'full-time', 1, 1491888176, 0),
(40, 0, 38, 'PCB Designer', NULL, 'The main role of a printed circuit board designer is to develop and test PCBs.A PCB designer works in front of a computer in an office or cubicle, either at an engineering firm or a manufacturing facility. ', 'Creating business opportunities with Defense Electronics R&D labs and PSUs. Good understanding of electronics technology, and a commitment to meet targets is essential. Excellent interpersonal & communication skills.\n', '3-5 yrs', 'BE/B. Tech Electronics/Computers', 'INR  not desclosed', 'full-time', 1, 1491888400, 0),
