(43, 0, 40, 'Senior Software Automation Engineer', NULL, '– Hands-on QA on Selenium, SoapUI and JMeter, Web Services testing, Manual functional testing.\n– Should have experience in developing automation tests using Java.\n– Database testing, Security testing, GUI/Usability testing, Stress testing.\n– The candidate should be proficient in test management tools and test design and estimation techniques.\n', '– Should be an ardent and passionate tester.\n– Decent knowledge of Java.\n– Exposure to selenium is important and Jmeter is a plus.\n– Good communication skills.', '5+ years', 'B.Tech/M.Tech/MCA', 'INR  not desclosed', 'Select Job Type', 1, 1491987954, 0),
(44, 0, 40, ' Sr. Software Engineer (Java)', NULL, '– Great opportunity to grow and contribute while engineering software product/solutions.\n– Looking for passionate out of the box thinkers and problem solvers to work in a challenging and dynamic environment lead by seasoned industry veterans.\n– Job would involve end to end designing and development of exciting Java based enterprise systems.', '- Should have 3-5 years of relevant experience\n– Should be an ardent and passionate programmer\n– Should have designed, developed and released at least 1 product/application of acceptable scale in an end to end manner\n– Be Strong in development processes and methods (e.g. version control, code review, release management)\n– Have in-depth understanding of Core Java, data structures, Spring MVC, hibernate, struts.\n– Should have in-depth knowledge of Application Servers (any of Tomcat, WebLogic etc) and understanding of SOA architecture (webServices)\n– Should be good in database query building and database design\n– Should have effective client communication skills\n– People from product development background will be strongly preferred\n– Good and Positive Attitude\n– Can do attitude\n– Excellent written and verbal communication skills\n– Can join immediately', '6+ years', 'Bachelor of Technology, Bachelor of Engineering\nJob Domain/Technology: Java', 'INR  not desclosed', 'full-time', 1, 1491988178, 0),
(45, 0, 40, 'Linguistic Consultant', NULL, '– Translation of documents/softwares from English-Foreign Language-English.\n– The work will entail you to proof-read the documents to detect and correct errors with regard to spelling, punctuation and syntax.\n– Broadly three kinds of work will be there:\na) Translation: company agrees to pay according to per word translation, based on the volume of work as Translators fee.\nb) Proof reading : company agrees to pay according to per word translated, based on the volume of work as Translators fee.\nc) Linguistic Testing (validating\\testing the localized web\\application pages): company agrees to pay according to per screen basis, on the volume of work as fee.', '– Excellent command over English and Chinese (said language) (read, written and verbal).\n– Knowledge of a second translation language will be distinct advantage.\n– An excellent knowledge of common software applications such as MS Office is a prerequisite.\n– Translation / editing certification from a recognized institute a plus .\n– Should be proficient in Windows OS, Knowledge of MAC would be a plus.\n– Knowledge of localization and linguistic testing will be an advantage.\n– Knowledge of Translation memory and tools (eg. TRADOS) will also be an advantage.', '0-3 yrs', 'Any Graduate, Post Graduate', 'INR  not desclosed', 'part-time', 1, 1491988403, 0),
(46, 0, 40, 'Sr. Software Engineer (Spark)', NULL, ' Data Science and Analytics\n- Experience with big data tools (Hadoop, Hive, MapReduce) a plus.\n- Domain knowledge of e-Learning will be good.', '– Good at Maths and/or statistics.\n- Experience in working with large data sets and using databases.\n- Good at concepts and analytical problem solving.\n- Good story telling and visualization skills.\n- Ability to develop and iterate models and analysis using python or other scripting languages on large datasets.\n- Inquisitive, love numbers, simply looking at data you can spot trends.\n- Understanding of advanced analytics (Predictive Modelling, Segmentation, forecasting, data mining, and optimization ) techniques.\n- Experience in using Business Intelligence tools such as: R, Stata, Excel (Analysis ToolPak, Miner), SAS, Tableau, MicroStrategy for analytical modeling and data management.\n- Strong communication and collaboration skills.', ' 3-5 Years', 'Bachelor of Technology, Bachelor of Engineering', 'INR  not desclosed', 'full-time', 1, 1491988603, 0),
(47, 0, 40, 'Software Automation Engineer', NULL, '– Hands-on QA on Selenium, SoapUI and JMeter, Web Services testing, Manual functional testing.\n– Should have experience in developing automation tests using Java.\n– Database testing, Security testing, GUI/Usability testing, Stress testing.\n– The candidate should be proficient in test management tools and test design and estimation techniques.\n', '– Should be an ardent and passionate tester.\n– Decent knowledge of Java.\n– Exposure to selenium is important and JMeter is a plus.\n– Good communication skills.', ':3+years', 'B.Tech/M.Tech/MCA', 'INR  not desclosed', 'full-time', 1, 1491988774, 0),
(48, 0, 40, 'Information Security Analyst', NULL, '– Expertise and experience of conducting vulnerability assessments as per standards such as OWASP Top 10, SANS Top 25 and WASC, NIST.\n– Hands-on experience with security tools – Metasploit, Nessus, Burpsuite, Acunetix, Checkmarx, AppScan, Nexpose, drozer, apktool, dex2jar, Checkmarx, AppScan, Fortify, Veracode, etc\n– Good knowledge of TCP/IP and other application and network level protocols\n– Hands on experience of developing exploits.\n– Hands on experience of using Kali Linux.\n– Ability to identify and provide remediation solution for mitigation of vulnerabilities.\n– Ability to conduct vulnerability assessment and penetration testing of networks, web applications using automated and manual approach.\n– Good understanding of attacks such as dhcp starvation, dns spoofing, email spoofing, phishing, DOS, DDOS, ARP poisoning, XSS, CSRF, SQL Injection, XXE, etc.\n– Good knowledge of security technologies for secure software development such as cryptography, authentication techniques, Protocols etc.\n– Good understanding of Secure SDLC.\n', '– Knowledge of Tools like IBM Appscan, Burp Suite, Nessus, Nmap etc.\n– Experience in Java Development will be preferred.\n– Recognized Industry certifications like CEH, LPT, ECSA or GIAC will be preferred.', '3-5 Years', 'B.Tech/M.Tech/MCA', 'INR  not desclosed', 'full-time', 1, 1491989002, 0),
