(196, 0, 103, 'Automation Testing Specialist', NULL, ' Automation Testing Specialist who has a significant experience in testing. One needs to be familiar with a variety of applications/tools including test automation software (e.g. QTP, Selenium), Source control (e.g. ClearCase, VSS, SVN and Rational), test management software (e.g. Quality Centre, TFS and MTM) and Microsoft applications such as Office and SQL.', 'Developing, maintaining and executing automated test scripts; Performing risk analysis with application for test prioritization; Working in a cooperative team environment; Getting involved in requirement review, walkthrough and discussions', '5-12 years of experience in automation testing', 'Bachelor’s or master’s degree in science, technology or computer applications', 'INR  not desclosed', 'full-time', 1, 1494052229, 0),
(197, 0, 103, 'Senior Systems Analyst', NULL, 'Design, develop, analyze, and modify existing computer systems.\nAnalyze user requirements to improve computer systems.\nReview new functionality to be implemented in the application.\nTest computer systems and correct errors to meet required specifications.', 'The one (1) year of IT experience must include experience using C++, OOPS, Unix Shell Scripting, Perl, MySQL, and Linux. In the alternative, we will accept a Bachelor’s Degree (or foreign equiv) in Computer Science, Engineering (any), Mathematics, or related field, plus five (5) years of progressive post-baccalaureate IT experience. One (1) year of the five (5) years of progressive post-baccalaureate IT experience must include experience using C++, OOPS, Unix Shell Scripting, Perl, MySQL, and Linux. All experience may be acquired concurrently.', '1- 12 yrs', 'Must have a Master’s Degree (or foreign equiv) in Computer Science, Engineering (any), Mathematics, or related field', 'INR  not desclosed', 'full-time', 1, 1494052396, 0),
(198, 0, 103, 'Database Administrator', NULL, ' to administer and test databases and correct errors using database management systems. This position qualifies under our incentive-based employee referral program.', 'Administer and test databases and correct errors using database management systems.Make required modifications to existing databases.Participate in the process of requirements capture and analysis for designing, developing and implementing database level stored procedures.Perform analysis of existing product functionality and prepare techno-functional specification documents to enable code changes; Responsible for coding components based on the project requirements and assigned technical design; Prepare required support documents for the interface and participate in knowledge transition sessions for the QA team; Review procedures in database management system to make changes to database.', 'two (2) years of IT experience. ', 'Must have a Bachelor’s Degree (or foreign equiv) in Computer Science, Engineering (any), Mathematics, or related field', 'INR  not desclosed', 'full-time', 1, 1494052583, 0),
(199, 0, 103, 'Computer Programmer Analyst', NULL, ' to analyze, design, develop, and test software applications.', 'Analyze, design, develop, and test software applications.Gather requirements, develop reports, and write functional and program specifications.', '2 yrs', 'Must have a Bachelor’s Degree (or foreign equiv) in Computer Science, Engineering (any), Mathematics, or related field, ', 'INR  not desclosed', 'full-time', 1, 1494052848, 0),
(200, 0, 103, 'Senior Manager / Director', NULL, 'This is a key Business Analyst and Consulting role which involves requirement gathering, specifications, testing, data extraction and project status tracking for multiple projects related to Risk Management, Derivatives and IT in Capital Markets group, specifically FI Derivatives. We are looking for an IT Risk BA who will be responsible for providing our client with risk indicators, risk weighted assets as well as limit and exposure reports. One will also focus on credit, counter party and market risk thereby covering both financing and capital markets areas.', 'Communicate with business sponsors, owners, users and other FO/BO application teams to understand their businesses; Proactively communicate and collaborate with business clients to analyze functional requirements and deliver the appropriate artifacts as and when needed\nAct as the first line of contact to interface with global risk management business users; Gather, analyze, extract and document business requirements of projects including use cases, data, function and quality requirements', '10-18 years of experience in Corporate and Investment Banking IT with direct experience in front-to-back FI trading, order processing and reporting', 'Graduation', 'INR  not desclosed', 'full-time', 1, 1494053164, 0),
