(222, 0, 111, 'PHP Developer', NULL, 'RV Technologies Software Pvt. Ltd is looking for young, energetic and talented candidate for the post of PHP Developers.\nCandidate must be cooperative and supportive with employees.\nCandidate must have good communication skills and pleasant personality.\nCandidate having experience of IT industry will get advantage\n', 'Candidate must be cooperative and supportive with employees.\nCandidate must have good communication skills and pleasant personality.\nCandidate having experience of IT industry will get advantage\n', 'Freshers/Exp. both can apply.\nCandidate having experience of IT industry will get advantage\n', 'Must be Graduate', '17000 per month', 'full-time', 1, 1496475235, 0),
