(224, 0, 112, 'HR Executive', NULL, '1) Recruiting and staffing.\n2) Performance management and improvement systems.\n3) Employment and compliance to regulatory concerns.\n4) Employee orientation, development, and training.\n5) Policy development and documentation.\n6) Employee relations & Grievance Handling\n7) Compensation and benefits administration.\n8) Employee safety, welfare, wellness and health.\n9) Maintaining Employee Records\n10) Implementation of Various HR Policies and their updation.\n11) Employee Engagement and Welfare Activities.\n12) Attendance, Leave Admin, Employee Exit Formalities.', 'Excellent communication, employee engagement, hiring, appraisal & increment, email writing, team handling.', '0.6 to 2.5 years', 'Graduation', '25000 per month', 'full-time', 1, 1496476765, 0),
