(228, 0, 115, 'Tele Verification', NULL, 'We are hiring for candidates for CCE Openings. *Bpo Inbound no target voice process. *We are hiring fresher candidates for Day shift Domestic Call Centers... *six days working fixed off Day shift Domestic Call Centers all over Delhi/NCR regions Fresher Candidate Apply *Key Skills: Calling, customer service, voice,support Candidate with good customer service skills would be preferred. *Candidate should have zero year of experience *Selected candidates will have choice to work either in Day or Night shifts.. *Interview Timings : 10:30 Am - 5:00 Pm WalkTime: full/part time, 10th pass Minimum Guidlines for Interview:: Well Groomed, Formal Dress .', 'Good communication skills\nGood interpersonal skills', 'Freshers/Exp. both can apply', 'Minimum 10th/12th required', '18000 per month', 'full-time', 1, 1496643164, 0),
(229, 0, 115, 'CCE', NULL, 'We are hiring for candidates for CCE Openings. *Bpo Inbound no target voice process. *We are hiring fresher candidates for Day shift Domestic Call Centers... *six days working fixed off Day shift Domestic Call Centers all over Delhi/NCR regions Fresher Candidate Apply *Key Skills: Calling, customer service, voice,support Candidate with good customer service skills would be preferred. *Candidate should have zero year of experience *Selected candidates will have choice to work either in Day or Night shifts.. *Interview Timings : 10:30 Am - 5:00 Pm WalkTime: full/part time, 10th pass Minimum Guidlines for Interview:: Well Groomed, Formal Dress .', 'Good communication skills\nGood interpersonal skills\nAbility to work in team', 'Freshers/Exp. both can apply', 'Minimum 10th/12th required', '18000 per month', 'full-time', 1, 1496644333, 0),
(230, 0, 112, 'Software Engineering ', NULL, 'We are looking for Software Engineering who can form and lead a highly technical and dynamic team. This team will be responsible to build and maintain our next generation software.', '• Lead a team of software developers with a broad range of responsibilities including software architecture, design, development, unit testing and software configuration management\n• Build software that is optimized, well organized and maintainable\n• Monitoring on-going risks and providing resolutions, driving process improvements, resource planning & optimization and performance management\n• Be responsible for migration of assigned platforms and processes as per project timelines and ensure smooth knowledge transfer in partnership with on-shore and offshore stakeholders\n• Partner with key stakeholders, both off-shore and on-shore, and delivering on the service level agreements', '• 5-8 years of software development experience with focus on leading teams to deliver technology focused projects preferred', '• B.E. / B. Tech. / MCA in Computer Science, Engineering or related field is required', '25000 per month', 'full-time', 1, 1496645218, 0),
(231, 0, 112, 'Associate Manager', NULL, 'We are looking for Associate Manager who can form and lead a highly technical and dynamic team. This team will be responsible to build and maintain our next generation software.', '• Lead a team of software developers with a broad range of responsibilities including software architecture, design, development, unit testing and software configuration management\n• Build software that is optimized, well organized and maintainable\n• Monitoring on-going risks and providing resolutions, driving process improvements, resource planning & optimization and performance management\n• Be responsible for migration of assigned platforms and processes as per project timelines and ensure smooth knowledge transfer in partnership with on-shore and offshore stakeholders\n• Partner with key stakeholders, both off-shore and on-shore, and delivering on the service level agreements\n• Coordinate architecture review, oversight, and implementation in conjunction with the WU-Architecture team\n• Invest time daily on all projects to remove impediments and provide solutions to technical challenges and make escalations as necessary\n• Participate in capacity and program planning exercises\n• Hire, manage and mentor a team of 6-10 engineers\n• Maintain effective communication with clients, business and partners as needed', '• 5-8 years of software development experience with focus on leading teams to deliver technology focused projects preferred', '• B.E. / B. Tech. / MCA in Computer Science, Engineering or related field is required', '26000 per month', 'full-time', 1, 1496645363, 0),
(232, 0, 114, 'Data Analytics', NULL, 'We are looking for Data Analytics who can form and lead a highly technical and dynamic team. This team will be responsible to build and maintain our next generation software.', '• Lead a team of software developers with a broad range of responsibilities including software architecture, design, development, unit testing and software configuration management\n• Build software that is optimized, well organized and maintainable\n• Monitoring on-going risks and providing resolutions, driving process improvements, resource planning & optimization and performance management\n• Be responsible for migration of assigned platforms and processes as per project timelines and ensure smooth knowledge transfer in partnership with on-shore and offshore stakeholders\n• Partner with key stakeholders, both off-shore and on-shore, and delivering on the service level agreements\n• Coordinate architecture review, oversight, and implementation in conjunction with the WU-Architecture team\n• Invest time daily on all projects to remove impediments and provide solutions to technical challenges and make escalations as necessary\n• Participate in capacity and program planning exercises\n• Hire, manage and mentor a team of 6-10 engineers\n• Maintain effective communication with clients, business and partners as needed.', '• 5-8 years of Data Analytic experience with focus on leading teams to deliver technology focused projects preferred', '• B.E. / B. Tech. / MCA in Computer Science, Engineering or related field is required', '22000 per month', 'full-time', 1, 1496645548, 0);
