INSERT INTO `template` (`id`, `template_name`, `subject`, `description`, `status`) VALUES
(1, 'Forget Password', 'Password Reset', '<p>#user#<br />\n<br />\nTo reset your password, visit the following address: #link#<br />\n<br />\n- Chandigarh Recruiters<br />\n<br />\n&nbsp;</p>\n', 1),
(2, 'Job Posted', 'Wait for approve to posted job!', '<div  center;"><strong>Dear #user#,</strong><br />\n<br />\nJob Title : #jobtitle#&nbsp; added successfull.<br />\nAdmin will check this job before publish.<br />\n<strong>- Chandigarh Recruiters</strong></div>\n', 1),
(3, 'New Referral Email', 'Congratulations! You Just Earned an $18 Commission', 'Dear #user#<br />\n<br />\nCongratulations on referring a new member to the Easy Cash Code Community.<br />\n<br />\nBelow are their contact details:<br />\n<br />\nName: #firstname# #lastname#<br />\nEmail: #email#<br />\nPhone number: #phone#<br />\n<br />\nDate of registration: #date#<br />\n<br />\nYou should contact them personally to welcome them to ECC.<br />\n<br />\nKeep up the great work!<br />\n<br />\n- Easy Cash Code Support', 1),
(4, 'Support Email Template', '[Easy Cash Code Support Request] #subject#', '<p>Dear #admin#,</p>\r\n\r\n<p>#username# has contacted you<br />\r\n<br />\r\nSubject : #subject#<br />\r\nMessage : #description#<br />\r\n<br />\r\nThanks<br />\r\n#username#</p>\r\n\r\n\r\n', 1),
(5, 'UOP SMS Pro Upgrade', 'Congratulations! You Just Earned an $20 Residual Commission', '<p>Dear #name#,<br />\n<br />\nYou just made a&nbsp;UOP SMS Pro $20&nbsp;residual sale&nbsp;from:<br />\n<br />\nName: #fname# #lname#<br />\nEmail: #email#<br />\nPhone number: #phone#<br />\n<br />\nYou should take a moment, and congratulate your team member,<br />\nand get excited! Remember, residual income comes in every month<br />\nas long as your team member remains active.<br />\n<br />\nKeep up the GREAT work!<br />\n<br />\n- Easy Cash Code Support</p>\n', 1),
(6, 'buyer_email', 'Congratulations! You have placed a new order.', '<p>Dear #name#,</p>\nProduct name : #pname#<br />\nEmail : #email#<br />\nPhone : #phone#<br />\nAddress : #address#<br />\nCountry : #country#<br />\nCity : #city#<br />\nZip_code : #zip_code#<br />\nState : #state#<br />\nDate: #date#<br />\nProduct amount : #amount#<br />\nPayment_method : #payment_method#<br />\n<br />\nThanks<br />\n- Easy Cash Code Team\n<p>&nbsp;</p>\n', 1),
(7, 'cancel_subscription ', 'Cancel Subscription', 'Dear #user#\r\n<br/>\r\nYour subscription has been canceled for Mobile purchase Software', 1),
(8, 'cancel_subscription_admin', 'Cancel Subscription', 'Dear #user#<br />\nSubscription for ECC Software Licensing Order has been canceled for #username# with&nbsp; User Name &quot;#user_name#&quot;.', 1),
(9, 'cancel_subscription_referal', 'Cancel Subscription', 'Dear #user#<br />\nSubscription for Mobile Purchase Order has been canceled for #username#', 1),
(10, 'Missed UOP SMS Pro Sale', 'You just lost a  $20 commission! New UOP SMS Pro Sale', '<span >Congrats #name#,<br />\n<br />\nYour Easy Cash Code System is working hard for you. However, you missed out<br />\non the commission because you were not an active reseller and/nor positioned<br />\nat the UOP SMS Pro level when that member joined.<br />\n<br />\nCustomer Name: #subscriber_name#<br />\nUser Name:  #username# <br/>\n<span >Payment: $20.00</span><br />\n<br />\n<span >Your Commission: $0</span> (Because you were not qualified for UOP SMS Pro Commissions)<br />\nYou could have earned: $20 in monthly residual income..<br />\n<br />\nConsider logging in your backoffice and upgrading today if you don''t want to miss out on<br />\nthese types of commissions from new members going forward.<br />\n<br />\nTo your success,<br />\n<br />\n- Easy Cash Code Support</span>', 1),
(11, 'Easy Cash Code Reseller payment', 'Congratulations! You Just Earned an $9.95 Residual Commission', '<p>Dear #name#,<br />\r\n<br />\r\nYou just made a&nbsp;UOP SMS Pro $9.95&nbsp;residual sale&nbsp;from:<br />\r\n<br />\r\nName: #fullname# <br />\r\nEmail: #email#<br />\r\nPhone number: #phone#<br />\r\n<br />\r\nYou should take a moment, and congratulate your team member,<br />\r\nand get excited! Remember, residual income comes in every month<br />\r\nas long as your team member remains active.<br />\r\n<br />\r\nKeep up the GREAT work!<br />\r\n<br />\r\n- Easy Cash Code Support</p>\r\n', 1),
(12, 'UOP SMS Pro Upgrade', 'Congratulations! You Just Earned an #amount# Residual Commission', '<p>Dear #name#,<br />\r\n<br />\r\nYou just made a&nbsp; #product_name# #amount#&nbsp;residual sale&nbsp;from:<br />\r\n<br />\r\nName: #fname# #lname#<br />\r\nEmail: #email#<br />\r\nPhone number: #phone#<br />\r\n<br />\r\nYou should take a moment, and congratulate your team member,<br />\r\nand get excited! Remember, residual income comes in every month<br />\r\nas long as your team member remains active.<br />\r\n<br />\r\nKeep up the GREAT work!<br />\r\n<br />\r\n- Easy Cash Code Support</p>\r\n', 1),
(13, 'Missed commission Sale', 'You just lost a  #amount# commission! New #product_name# Sale', '<span >Congrats #name#,<br />\r\n<br />\r\nYour Easy Cash Code System is working hard for you. However, you missed out<br />\r\non the commission because you were not an active reseller and/nor positioned<br />\r\nat the #product_name# when that member joined.<br />\r\n<br />\r\nCustomer Name: #subscriber_name#<br />\r\nUser Name:  #username# <br/>\r\n<span >Payment: #amount#</span><br />\r\n<br />\r\n<span >Your Commission: $0</span> (Because you were not qualified for #product_name Commissions)<br />\r\nYou could have earned: #amount# in monthly residual income..<br />\r\n<br />\r\nConsider logging in your backoffice and upgrading today if you don''t want to miss out on<br />\r\nthese types of commissions from new members going forward.<br />\r\n<br />\r\nTo your success,<br />\r\n<br />\r\n- Easy Cash Code Support</span>', 1),
(14, 'Missed commission Sale', 'You just lost a  #amount# commission! New #product_name# Sale', '<span >Congrats #name#,<br />\r\n<br />\r\nYour Easy Cash Code System is working hard for you. However, you missed out<br />\r\non the commission because you were not an active reseller and/nor positioned<br />\r\nat the #product_name# when that member joined.<br />\r\n<br />\r\nCustomer Name: #subscriber_name#<br />\r\nUser Name:  #username# <br/>\r\n<span >Payment: #amount#</span><br />\r\n<br />\r\n<span >Your Commission: $0</span> (Because you were not qualified for #product_name Commissions)<br />\r\nYou could have earned: #amount# in monthly residual income..<br />\r\n<br />\r\nConsider logging in your backoffice and upgrading today if you don''t want to miss out on<br />\r\nthese types of commissions from new members going forward.<br />\r\n<br />\r\nTo your success,<br />\r\n<br />\r\n- Easy Cash Code Support</span>', 1),
(15, 'cancel subscription for product', 'A Team Member Cancelled #product_name# Subscription', 'Dear #user#<br />\n<br />\nJust giving you heads up that subscription for #product_name# has been<br />\ncancelled by username: #username#<br />\n<br />\nRegards,<br />\n<br />\n- Easy Cash Code Support', 1),
(16, 'cancel subscription for product ', 'A Team Member Cancelled #product_name# Subscription', 'Dear #user#<br />\n<br />\nJust giving you heads up that subscription for #product_name# has been<br />\ncancelled by username: #username#<br />\n<br />\nRegards,<br />\n<br />\n- Easy Cash Code Support', 1),
(18, 'Missed UOP SMS Pro Admin Sale', 'You have missed UOP SMS pro sale', 'Dear #user#<br />\r\n\r\nYou have missed UOP SMS pro because you reseller account is deactivated...', 1),
(20, 'Missed UOP SMS Pro Admin Sale', 'You just lost a  #amount# commission! New #product_name# Sale', 'Dear #user#<br />\r\n\r\nYou have missed commission sale for #product_name# of #amount# because you reseller account is deactivated...', 1),
(21, '$18 Passup Sale Template', 'Congratulations! You Just Referred An Qualifying Sale', 'Dear #user#<br />\n<br />\nCongratulations on referring a new member to the Easy Cash Code Community.<br />\nThis was your second qualifying sale, so it was passed up to admin. You are&nbsp;<br />\nnow fully qualified and all future $18 sales will be paid to you...<br />\n<br />\nHere&#39;s the details:<br />\n<br />\nName: #name#<br />\nEmail: #email#<br />\nUsername: #username#<br />\nDate of registration:&nbsp;#date#<br />\n<br />\nYou should contact them personally to welcome them to ECC. Be sure<br />\nto add them to your Facebook Community!<br />\n<br />\nKeep up the great work!<br />\n<br />\n-Easy Cash Code Support', 1),
(25, 'admin reseller licence ', 'Your Have successfully subscribed for Reseller Subscription', 'Dear #user# <br />\r\n\r\nYour Have successfully subscribed for Reseller Subscription by admin. Your Details are :<br/>\r\nName : #name#<br/>\r\nEmail : #email# <br/>\r\nProduct : ECC Software & Reseller Licensing <br/>\r\n\r\n\r\nThanks\r\n\r\n   \r\n', 1),
(26, 'UOP SMS Pro subscription activation', 'UOP SMS Pro subscription activation', 'Dear #user# <br />\r\n\r\nYour Have successfully subscribed for UOP SMS Pro Subscription. Your Details are :<br/>\r\nName : #name#<br/>\r\nEmail : #email# <br/>\r\nProduct : UOP SMS Pro <br/>\r\nAmount : #amount# <br/>\r\n\r\nThanks', 1),
(27, 'Subscription payment from admin', 'You have successfully subscribed for #product_name# ', 'Dear #user#<br/>\r\n\r\nYou have successfully subscribed for #product_name# for #amount#<br/>\r\n\r\n\r\nThanks', 1),
(28, 'one time payment from admin', 'You have successfully paid for #product_name# ', 'Dear #user#<br/>\r\n\r\nYou have successfully paid for #product_name# for #amount#\r\n<br/>\r\n\r\nThanks', 1),
(29, 'Cancel Subscription by admin', 'Your subscription cancelled for #product_name#', 'Dear #user#\r\n\r\nYour subscription cancelled for #product_name#\r\n<br/>\r\nThanks', 1),
(30, 'Easy Cash Code Reseller One Time payment', 'Congratulations! You Just Earned an $197 Residual Commission', '<p>Dear #name#,<br />\r\n<br />\r\nYou just made a&nbsp;ECC Software Licensing&nbsp; Admin Fee $197 residual one time sale&nbsp;from:<br />\r\n<br />\r\nName: #fullname#<br />\r\nEmail: #email#<br />\r\nPhone number: #phone#<br />\r\n<br />\r\nYou should take a moment, and congratulate your team member,<br />\r\nand get excited!<br />\r\n<br />\r\nKeep up the GREAT work!<br />\r\n<br />\r\n- Easy Cash Code Support</p>\r\n', 1),
(31, 'user_payment_got_declined', 'User Payment Got Declined', 'Dear #user#<br />\n<br />\nYour New Referral Account has been not created for #username#<br />\nReason: #reason#<br />\nEmail id : #email#<br />\n<br />\nThank you', 1),
(33, 'product_payment_problem', 'Product Payment Problem', 'Dear #user#<br />\n<br />\nYour Referral Subscription Payment For Plan is not completed for #username#<br />\nFull Name: #fullname#<br />\nReason: #reason#<br />\nProduct Name : #pid#<br />\n<br />\nThank You', 1),
(34, 'one time product sale', 'Congratulations! You Just Earned an #amount# Residual Commission', '<p>Dear #name#,<br />\r\n<br />\r\nYou just made a&nbsp; #product_name# #amount#&nbsp;residual sale&nbsp;from:<br />\r\n<br />\r\nName: #fname# #lname#<br />\r\nEmail: #email#<br />\r\nPhone number: #phone#<br />\r\n<br />\r\nYou should take a moment, and congratulate your team member,<br />\r\nand get excited! Remember, residual income comes in every month<br />\r\nas long as your team member remains active.<br />\r\n<br />\r\nKeep up the GREAT work!<br />\r\n<br />\r\n- Easy Cash Code Support</p>\r\n', 1),
(35, 'one time product user email', 'Congratulations! You have placed a new order.', '<p>Dear #name#,</p>\r\nProduct name : #pname#<br />\r\nEmail : #email#<br />\r\nPhone : #phone#<br />\r\nAddress : #address#<br />\r\nCountry : #country#<br />\r\nCity : #city#<br />\r\nZip_code : #zip_code#<br />\r\nState : #state#<br />\r\nDate: #date#<br />\r\nProduct amount : #amount#<br />\r\nPayment_method : #payment_method#<br />\r\n<br />\r\nThanks<br />\r\n- Easy Cash Code Team\r\n<p>&nbsp;</p>\r\n', 1),
(36, 'Your Sale is Passed Up ', 'Your Sale is Passed Up ', 'Dear #user# <br/>\r\n \r\nYour Sale is Passed up to #username# for #product_name#.<br/>\r\n\r\n\r\nThanks', 1),
(37, 'Can''t Access My Account', 'Account Recover Successfully', '\r\nDear #name#\r\n<br>\r\nAs per your request , we are addressing this email . \r\n<br>\r\nBelow are the credentials for your account on easy cash code\r\n<br>\r\nUsername: #username#\r\nEmail : #email#\r\nPassword: ******** (click to reset)\r\n<br><br>\r\nThanks and Regards\r\nEasy Cash Code Support', 1);
